import styled from "styled-components";

export const HomePageContainer = styled.div`
  .homepage {
    display: flex;
    flex-direction: column;
    align-items: center;
    padding: 20px 80px;
  }

  .logo {
    width: 100% !important;
    padding: 0 !important;
    margin: 0 !important;
  }
`;
